import React from 'react';
import Autocomplete from 'react-google-autocomplete';

const SearchMap=({onPlaceSelected,choisirMoto,choisirVoiture,choisirMotoVoiture,choisirZone,choisirRoute,choisirRouteZone  }) =>{
  return (
    <div>
  <Autocomplete
                             className='mb2 pa3 ba b--green bg-lightest-blue'
                            onPlaceSelected={onPlaceSelected}
                            types={['(regions)']}
                            placeholder='choisir un lieu'
                        /> 
<select>
    <option value="" disabled selected>vehicule type</option>
    <option value="moto" onClick={()=>choisirMoto()}>Moto</option>
    <option value="voiture" onClick={()=>choisirVoiture()}>Voiture</option>
    <option value="motoVoiture" onClick={()=>choisirMotoVoiture()}>Les Deux</option>
</select>
<select>
    <option value="" disabled selected>Covoiturage type</option>
    <option value="zone" onClick={()=>this.choisirZone()}>Zone</option>
    <option value="route" onClick={()=>this.choisirRoute()}>Route</option>
    <option value="zoneRoute" onClick={()=>this.choisirRouteZone()}>Les Deux</option>
</select>
   </div>             
  	);
}
export default SearchMap;
